#!/usr/bin/env python3
"""Self-contained script to create a RecallAI bot for a meeting URL.

Usage:
    pip install httpx
    python create_bot.py
"""

import asyncio
import base64
from typing import Any

import httpx

# Configuration
RECALLAI_API_KEY = "60167bf56c5d272df513f57b2fc097f530bfd52c"
RECALLAI_API_URL = "https://us-west-2.recall.ai/api/v1"
DEFAULT_BOT_NAME = "Clarity's Security Agent"
MAX_BOT_IMAGE_SIZE = 5 * 1024 * 1024  # 5MB max

# Embedded bot image (base64-encoded JPEG)
BOT_IMAGE_B64 = """

"""


def load_bot_image() -> str | None:
    """Load the embedded bot image.

    Returns:
        Base64-encoded image string, or None if invalid
    """
    content = BOT_IMAGE_B64.strip()

    # Validate base64 content and size
    try:
        decoded = base64.b64decode(content)
        if len(decoded) > MAX_BOT_IMAGE_SIZE:
            print(f"Warning: Bot image exceeds max size ({len(decoded)} > {MAX_BOT_IMAGE_SIZE})")
            return None
        print(f"Loaded embedded bot image ({len(decoded)} bytes)")
    except Exception as e:
        print(f"Warning: Invalid base64 content in embedded image: {e}")
        return None

    return content


def build_request_payload(
    meeting_url: str,
    bot_name: str,
    bot_image_b64: str | None,
) -> dict[str, Any]:
    """Build the request payload for creating a bot."""
    payload: dict[str, Any] = {
        "meeting_url": meeting_url,
        "bot_name": bot_name,
        "recording_config": {
            "video_mixed_layout": "speaker_view",
        },
    }

    if bot_image_b64:
        payload["automatic_video_output"] = {
            "in_call_recording": {
                "kind": "jpeg",
                "b64_data": bot_image_b64,
            }
        }

    return payload


async def create_bot(meeting_url: str, bot_name: str | None = None) -> None:
    """Create a RecallAI bot for the given meeting URL.

    Args:
        meeting_url: Zoom or Teams meeting URL
        bot_name: Optional custom bot name
    """
    bot_name = bot_name or DEFAULT_BOT_NAME

    # Load the bot image
    bot_image_b64 = load_bot_image()

    # Build request payload
    payload = build_request_payload(meeting_url, bot_name, bot_image_b64)

    print(f"Creating bot '{bot_name}' for meeting: {meeting_url}")

    async with httpx.AsyncClient(
        base_url=RECALLAI_API_URL,
        headers={
            "Authorization": f"Token {RECALLAI_API_KEY}",
            "Content-Type": "application/json",
            "Accept": "application/json",
        },
    ) as client:
        response = await client.post("/bot", json=payload)

        if response.status_code >= 400:
            print(f"\n Failed to create bot!")
            print(f"   Error: API returned status {response.status_code}")
            print(f"   Details: {response.text}")
            return

        data = response.json()

        print(f"\n Success! Bot created and will join your meeting.")
        print(f"   Bot ID: {data.get('id')}")
        print(f"   Bot Name: {data.get('bot_name')}")


def main():
    print("=" * 50)
    print("RecallAI Bot Creator")
    print("=" * 50)
    print()

    meeting_url = input("Please paste your Zoom or Teams meeting link: ").strip()

    if not meeting_url:
        print("\n Error: No meeting link provided.")
        return

    print()
    asyncio.run(create_bot(meeting_url))


if __name__ == "__main__":
    main()
